pragma solidity ^0.5.0;

contract CaseContract {

    address public manager;
    string public status;

    struct Feedback{
        uint id;
        uint date;
        uint createdAt;
        bytes32 commentHashed;
        bytes32 feedbackAddressHashed;
        bytes32 latitudeHashed;
        bytes32 longitudeHashed;
        bytes32 currentLatitudeHashed;
        bytes32 currentLongitudeHashed;
        bytes32 sourceHashed;
        bytes32 feedbackImageHashed;
    }

    mapping(uint => Feedback) public feedbacks;

    modifier managerOnly {
        require(msg.sender == manager, "forbidden");
        _;
    }

    constructor(address payable _manager, string memory _status) public{
        manager = _manager;
        status = _status;
    }

    function createFeedback(uint _id, bytes32 _comment, bytes32 _feedbackAddress, bytes32 _latitude,
        bytes32 _longitude, bytes32 _currentLatitude, bytes32 _currentLongitude, bytes32 _source,
        uint _date, uint _createdAt, bytes32 _feedbackImage) public managerOnly {
        feedbacks[_id] = Feedback(
            _id,
            _date,
            _createdAt,
            _comment,
            _feedbackAddress,
            _latitude,
            _longitude,
            _currentLatitude,
            _currentLongitude,
            _source,
            _feedbackImage
        );
    }

    function changeStatus(string memory _status) public managerOnly {
        status = _status;
    }
}
